pragma solidity ^0.8.28;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "hardhat/console.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

contract NftAuction is Initializable {
  // 结构体
  struct Auction {
    /** 卖家 */
    address seller;
    /** 持续时间 */
    uint256 duration;
    /** 起拍价 */
    uint256 startPrice;
    /** 开始时间 */
    uint256 startTime;
    /** 是否结束 */
    bool ended;
    /** 最高出价者 */
    address highestBidder;
    /** 最高价格 */
    uint256 highestBid;
    /** NFT合约地址 */
    address nftContract;
    /** NFT的tokenId */
    uint256 tokenId;
  }

  // 状态变量
  /** id和卖家的映射 */
  mapping(uint256 => Auction) public auctions;
  /** 下一个拍卖ID */
  uint256 public nextAuctionId;
  /** 管理员地址 */
  address public admin;

  // constructor() {
  //   admin = msg.sender;
  // }
  function initialize() public initializer {
    admin = msg.sender;
  }
  /** 创建拍卖 */
  function createAuction(uint256 _duration, uint256 _startPrice, address _nftContract, uint256 _tokenId) public {
    // 检查参数
    // 只有管理员才可以创建拍卖
    require(msg.sender == admin, "only admin");
    // 持续时间必须大于1分钟
    require(_duration > 1000 * 60, "duration must be > 1 minute");
    // 起拍价必须大于0
    require(_startPrice > 0, "startPrice must be > 0");
    // 创建拍卖
    auctions[nextAuctionId] = Auction({
      seller: msg.sender,
      duration: _duration,
      startPrice: _startPrice,
      ended: false,
      highestBidder: address(0),
      highestBid: 0,
      startTime: block.timestamp,
      nftContract: _nftContract,
      tokenId: _tokenId
    });
    nextAuctionId++;
  }

  // 买家出价
  function playerBid(uint256 _auctionId) public payable {
    // 检查拍卖是否存在
    Auction storage auction = auctions[_auctionId];
    // 判断当前拍卖是否结束, 只有在拍卖结束后才能出价
    require(!auction.ended && (auction.startTime + auction.duration > block.timestamp), "auction ended");
    // 出价必须大于当前最高价, 出价必须大于等于起拍价
    require(msg.value >= auction.highestBid && msg.value >= auction.startPrice, "bid must be >= startPrice");
    // 退回之前最高出价者的金额
    if (auction.highestBidder != address(0)) {
      payable(auction.highestBidder).transfer(auction.highestBid);
    }
    // 更新最高出价者和最高出价
    auction.highestBidder = msg.sender;
    auction.highestBid = msg.value;
  }
}","keccak256":"0xd7fb32e52b546950e32145b665a0228672aa0c036b321b7d63c664487f2e30ac","license":"SEE LICENSE IN LICENSE"},"contracts/NftAuctionV2.sol":{"content":"// SPDX-License-Identifier: SEE LICENSE IN LICENSE
